    data: |
      SELECT DISTINCT + 4 / ( col0 * ( cor0.col0 ) ) + col0 + + col0 * col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q5151.out
    data: |
      2088
      3430
      8188
